import React from 'react';
import ReactDOM from 'react-dom';

function Welcome(props) {
    return <table>Hello, {props.name}</table>;
}

function App() {
    return (
        <div>
            <Welcome name="Sara" />
            <Welcome name="Cahal" />
            <Welcome name="Edite" />
        </div>
    );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
